import React from 'react';

const Graphic = (props) => {
    return (
        <>

        <div className="col-lg-3 col-md-4 col-6 ">
            <figure>
            <img className="img-fluid" src={props.img} alt="...." />
      
            </figure>
        </div>
       
        




        </>
    )
}

export default Graphic;
